import logo from './logo.svg';
import Customer from "./components/Customer";

function App() {
  const customer = {
    'id' : 1,
    'image' : 'http://placeimg.com/64/64any',
    'name' : '마호돌',
    'birthday' : '890112',
    'gender' : '남자',
    'job' : '교사'
  }
  return (
    <Customer
      id = {customer.id}
      image = {customer.image}
      name ={customer.name}
      birthday = {customer.birthday}
      gender = {customer.gender}
      job = {customer.job}
    />
  );
}

export default App;
